import React from 'react';
import Carousel from "nuka-carousel"

const App = () => {
  return (
    <Carousel>
      <img src="/image1.png" />
      <img src="/image2.png" />
      <img src="/image3.png" />
      <img src="/image4.png" />
      <img src="/image5.png" />
    </Carousel>
  )
}

export default Example;
